import React from 'react';

function HomePage() {
    return (
        <div className="text-center">
            <h2>Selamat Datang di Aplikasi Akuntasi</h2>
            <p>Gunakan navigasi untuk melihat dan mengelola Keuangan Anda.</p>
        </div>
    );
}

export default HomePage;
